css:
atom-text-editor::shadow .relative.current-line {
  color: #5293d8;
}
atom-text-editor::shadow .absolute {
  display: none;
}
atom-text-editor::shadow .gutter[gutter-name='relative-numbers'] {
  display: none;
}
atom-text-editor.vim-mode.insert-mode::shadow .absolute,
atom-text-editor.vim-mode-plus.insert-mode::shadow .absolute {
  display: inline;
}
atom-text-editor.vim-mode.insert-mode::shadow .relative,
atom-text-editor.vim-mode-plus.insert-mode::shadow .relative {
  display: none;
}
atom-text-editor::shadow .show-absolute .absolute {
  display: inline;
  margin-right: 1em;
  color: rgba(131, 148, 150, 0.5);
}
atom-text-editor::shadow .show-absolute .relative {
  display: inline !important;
}
